import React from 'react';

import { HashRouter, Route, Link, Switch} from 'react-router-dom';
import HomePage from './home_page/home_page';

function App() {
  return (
    <HashRouter basename="/">
      <Route path='/home_page' exact>
        <HomePage/>
      </Route>







    </HashRouter>
  );
}

export default App;
